import React from "react";
import "./App.css";
import Login from "./component/Login";
import ForgotPassword from "./component/ForgotPassword";
import ResetPassword from "./component/ResetPassword";
import Register from "./component/Register";
import Dashboard from "./component/Dashboard";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Drawerdashboard from "./component/Drawerdashboard";
import Profile from "./component/Profile";
import  createNote from "./component/CreateNote"
import  Showmoreoption from "./component/Showmoreoption"
import AddArchive from "./component/AddArchive";
import Addlabel from "./component/Addlabel";
import Reminder from './component/Reminder';
import Trash from "./component/Trash";
import ShowNote from "./component/ShowNote";
import Archive from "./component/Archive";

function App() {
  return (
    <div className="App">
      <Router>
          <Route path="/" exact={true} component={Login} />
          <Route path="/register" component={Register} />
          <Route path="/ForgotPassword" component={ForgotPassword} />
          <Route path="/ResetPassword" component={ResetPassword} />
          <Route path="/Dashboard" component={Dashboard}/>
          <Route path="/Dashboard/note" component={ShowNote}/>
          {/* <Route path="/Dashboard/note" component={Dashboard}/> */}
          <Route path="/Dashboard/reminder" component={Reminder}/>
          <Route path="/Dashboard/trash" component={Trash}/>
          <Route path="/Dashboard/archive" component={Archive}/>
      </Router>

    </div>
  );
}

export default App;
